void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = iResolution.xy/fragCoord;

    // Time varying pixel color
    vec3 col = tan(tan(tan(tan(tan(tan(tan(tan(tan(uv.xyx))))))))) + tan(tan(tan(tan(tan(tan(tan(tan(tan(iTime+uv.xyx+vec3(2,9,3))))))))));

    // Output to screen
    fragColor = vec4(col,.1);
    }
